resources.string:
Atcerieties apmeklētās vietas, atklājot fotoattēlus, kuros ir iekļauta informācijas par atrašanās vietu, tostarp kopīgotos fotoattēlus, kurus esat saglabājis. Jūsu kartē tiek izmantota šāda atrašanās vietas informācija:

 • jūsu kameras GPS;
 • noteiktie orientieri.

Bloķētajā mapē esošie fotoattēli un videoklipi, kas nav dublēti, netiks paturēti, ja:

 • nomainīsiet ierīces;
 • atiestatīsiet šajā ierīcē rūpnīcas datus;
 • izdzēsīsiet lietotni Google fotoattēli.

No jūsu ierīces tiks neatgriezeniski izdzēsti šādi lietotnes “Google fotoattēli” dati: 

• konti, kuros esat pierakstījies; 
• iestatījumi; 
• bloķētajā mapē saglabāti fotoattēli un videoklipi, kas nav dublēti. 

Citās mapēs saglabātie fotoattēli un videoklipi un citi lietotņu dati netiks dzēsti.
